import React, { Component } from "react";
import FormField from "./formField";

class Form extends Component {
  state = {
    formFields: [
      { name: 1, value: 0 },
      { name: 2, value: 0 },
      { name: 3, value: 0 },
      { name: 4, value: 0 },
    ],
  };
  render() {
    return (
      <div>
        {this.state.formFields.map((formFields) => (
          <FormField key={formFields.name} />
        ))}
      </div>
    );
  }
}

export default Form;
